CREATE TABLE lms ( id UUID NOT NULL DEFAULT gen_random_uuid(),
	"name" STRING NOT NULL,
	created_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(),
	created_by UUID NOT NULL,
	updated_at TIMESTAMP WITH TIME ZONE NULL,
	updated_by UUID NULL,
	CONSTRAINT "primary" PRIMARY KEY (id ASC),
	UNIQUE INDEX lms_name_key ("name" ASC),
	FAMILY "primary" (id, "name", created_at, created_by, updated_at, updated_by)
);

CREATE TABLE country (
	id UUID NOT NULL DEFAULT gen_random_uuid(),
	"name" STRING NOT NULL,
	code STRING NOT NULL,
	currency STRING NOT NULL,
	created_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(),
	created_by UUID NOT NULL,
	updated_at TIMESTAMP WITH TIME ZONE NULL,
	updated_by UUID NULL,
	CONSTRAINT "primary" PRIMARY KEY (id ASC),
	UNIQUE INDEX country_name_key ("name" ASC),
	UNIQUE INDEX country_code_key (code ASC),
	INDEX country_code_idx (currency ASC),
	INDEX country_name_idx ("name" ASC),
	FAMILY "primary" (id, "name", code, currency, created_at, created_by, updated_at, updated_by)
);

CREATE TABLE bank (
	id UUID NOT NULL DEFAULT gen_random_uuid(),
	"name" STRING NOT NULL,
	country_id UUID NOT NULL,
	created_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(),
	created_by UUID NOT NULL,
	updated_at TIMESTAMP WITH TIME ZONE NULL,
	updated_by UUID NULL,
	CONSTRAINT "primary" PRIMARY KEY (id ASC),
	UNIQUE INDEX bank_name_key ("name" ASC),
	CONSTRAINT fk_bank_country FOREIGN KEY (country_id) REFERENCES country (id),
	INDEX country_idx (country_id ASC),
	FAMILY "primary" (id, "name", country_id, created_at, created_by, updated_at, updated_by)
);

CREATE TABLE programme (
	id UUID NOT NULL DEFAULT gen_random_uuid(),
	"name" STRING NOT NULL,
	logo STRING NULL,
	personnel STRING NULL,
	card_number_format STRING NULL,
	lms_id UUID NOT NULL,
	bank_id UUID NULL,
	issuer_point INT NOT NULL,
	issuer_currency DECIMAL(20,5) NOT NULL,
	point_discount_rate_percentage DECIMAL(20,5) NOT NULL,
	min_redeem_percentage DECIMAL(20,5) NOT NULL,
	facilitation_fee DECIMAL(20,5) NOT NULL,
	point_cancel_fee DECIMAL(20,5) NOT NULL,
	currency_cancel_fee DECIMAL(20,5) NOT NULL,
	is_active BOOL NOT NULL DEFAULT false,
	description STRING NOT NULL,
	created_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(),
	created_by UUID NOT NULL,
	updated_at TIMESTAMP WITH TIME ZONE NULL,
	updated_by UUID NULL,
	CONSTRAINT "primary" PRIMARY KEY (id ASC),
	UNIQUE INDEX programme_name_key ("name" ASC),
	CONSTRAINT fk_programme_lms FOREIGN KEY (lms_id) REFERENCES lms (id),
	INDEX programme_auto_index_fk_programme_lms (lms_id ASC),
	CONSTRAINT fk_programme_bank FOREIGN KEY (bank_id) REFERENCES bank (id),
	INDEX programme_auto_index_fk_programme_bank (bank_id ASC),
	FAMILY "primary" (id, "name", logo, personnel, card_number_format, lms_id, bank_id, issuer_point, issuer_currency, point_discount_rate_percentage, min_redeem_percentage, facilitation_fee, point_cancel_fee, currency_cancel_fee, is_active, description, created_at, created_by, updated_at, updated_by)
);

CREATE TABLE "user" (
	id UUID NOT NULL DEFAULT gen_random_uuid(),
	full_name STRING NOT NULL,
	email STRING NOT NULL,
	password STRING NOT NULL,
	phone_number STRING NOT NULL,
	is_active BOOL NULL DEFAULT false,
	programme_id UUID NOT NULL,
	created_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(),
	created_by UUID NOT NULL,
	updated_at TIMESTAMP WITH TIME ZONE NULL,
	updated_by UUID NULL,
	CONSTRAINT "primary" PRIMARY KEY (id ASC),
	UNIQUE INDEX user_email_key (email ASC),
	UNIQUE INDEX user_phone_number_key (phone_number ASC),
	CONSTRAINT fk_user_programme FOREIGN KEY (programme_id) REFERENCES programme (id),
	INDEX user_auto_index_fk_user_programme (programme_id ASC),
	FAMILY "primary" (id, full_name, email, password, phone_number, is_active, programme_id, created_at, created_by, updated_at, updated_by)
);

CREATE TABLE access (
	id UUID NOT NULL DEFAULT gen_random_uuid(),
	"name" STRING NOT NULL,
	created_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(),
	created_by UUID NOT NULL,
	updated_at TIMESTAMP WITH TIME ZONE NULL,
	updated_by UUID NULL,
	CONSTRAINT "primary" PRIMARY KEY (id ASC),
	UNIQUE INDEX access_name_key ("name" ASC),
	FAMILY "primary" (id, "name", created_at, created_by, updated_at, updated_by)
);

CREATE TABLE client (
	id UUID NOT NULL DEFAULT gen_random_uuid(),
	"name" STRING NOT NULL,
	address STRING NULL,
	country_id UUID NOT NULL,
	pic STRING NOT NULL,
	email STRING NOT NULL,
	is_active BOOL NOT NULL DEFAULT false,
	commission_fee DECIMAL(20,5) NOT NULL DEFAULT 0:::DECIMAL,
	pg_fee DECIMAL(20,5) NOT NULL DEFAULT 0:::DECIMAL,
	redirect_uri STRING NOT NULL,
	callback_uri STRING NOT NULL,
	created_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(),
	created_by UUID NOT NULL,
	updated_at TIMESTAMP WITH TIME ZONE NULL,
	updated_by UUID NULL,
	CONSTRAINT "primary" PRIMARY KEY (id ASC),
	UNIQUE INDEX client_name_key ("name" ASC),
	UNIQUE INDEX client_email_key (email ASC),
	CONSTRAINT fk_client_country FOREIGN KEY (country_id) REFERENCES country (id),
	INDEX client_auto_index_fk_client_country (country_id ASC),
	FAMILY "primary" (id, "name", address, country_id, pic, email, is_active, commission_fee, pg_fee, redirect_uri, callback_uri, created_at, created_by, updated_at, updated_by)
);

CREATE TABLE currency_rate (
	id UUID NOT NULL DEFAULT gen_random_uuid(),
	currency_from STRING NOT NULL,
	currency_to STRING NOT NULL,
	rate DECIMAL(20,5) NOT NULL DEFAULT 0:::DECIMAL,
	created_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(),
	created_by UUID NOT NULL,
	updated_at TIMESTAMP WITH TIME ZONE NULL,
	updated_by UUID NULL,
	CONSTRAINT "primary" PRIMARY KEY (id ASC),
	FAMILY "primary" (id, currency_from, currency_to, rate, created_at, created_by, updated_at, updated_by)
);

CREATE TABLE transaction_state (
	id UUID NOT NULL DEFAULT gen_random_uuid(),
	"name" STRING NOT NULL,
	created_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(),
	created_by UUID NOT NULL,
	updated_at TIMESTAMP WITH TIME ZONE NULL,
	updated_by UUID NULL,
	CONSTRAINT "primary" PRIMARY KEY (id ASC),
	UNIQUE INDEX transaction_state_name_key ("name" ASC),
	FAMILY "primary" (id, "name", created_at, created_by, updated_at, updated_by)
);

CREATE TABLE transaction (
	id UUID NOT NULL DEFAULT gen_random_uuid(),
	client_invoice_number STRING NOT NULL,
	customer_first_name STRING NOT NULL,
	customer_last_name STRING NOT NULL,
	customer_email STRING NOT NULL,
	customer_phone STRING NOT NULL,
	expiry_start_time TIMESTAMP WITH TIME ZONE NOT NULL,
	expiry_unit STRING NOT NULL,
	expiry_duration INT NOT NULL,
	client_id UUID NOT NULL,
	programme_id UUID NOT NULL,
	transaction_timestamp TIMESTAMP WITH TIME ZONE NOT NULL,
	point_amount DECIMAL(20,5) NOT NULL,
	money_amount DECIMAL(20,5) NOT NULL,
	invoice_amount DECIMAL(20,5) NOT NULL,
	last_state UUID NOT NULL,
	payment_method STRING NOT NULL,
	promotional_code STRING NOT NULL,
	promotional_points DECIMAL(20,5) NOT NULL DEFAULT 0:::DECIMAL,
	exchange_from STRING NOT NULL,
	exchange_to STRING NOT NULL,
	current_rate DECIMAL(20,5) NOT NULL,
	client_commission_fee DECIMAL(20,5) NOT NULL,
	client_pg_fee DECIMAL(20,5) NOT NULL,
	programme_issuer_point INT NOT NULL,
	programme_issuer_currency DECIMAL(20,5) NOT NULL,
	programme_point_discount_rate_percentage DECIMAL(20,5) NOT NULL,
	programme_min_redeem_percentage DECIMAL(20,5) NOT NULL,
	programme_facilitation_fee DECIMAL(20,5) NOT NULL,
	programme_point_cancel_fee DECIMAL(20,5) NOT NULL,
	programme_currency_cancel_fee DECIMAL(20,5) NOT NULL,
	finished_at TIMESTAMP WITH TIME ZONE NULL,
	created_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(),
	created_by UUID NOT NULL,
	updated_at TIMESTAMP WITH TIME ZONE NULL,
	updated_by UUID NULL,
	CONSTRAINT "primary" PRIMARY KEY (id ASC),
	INDEX invoice_number_idx (client_invoice_number ASC),
	INDEX finished_at_idx (finished_at ASC),
	CONSTRAINT fk_transaction_client FOREIGN KEY (client_id) REFERENCES client (id),
	INDEX transaction_auto_index_fk_transaction_client (client_id ASC),
	CONSTRAINT fk_transaction_programme FOREIGN KEY (programme_id) REFERENCES programme (id),
	INDEX transaction_auto_index_fk_transaction_programme (programme_id ASC),
	CONSTRAINT fk_transaction_state FOREIGN KEY (last_state) REFERENCES transaction_state (id),
	INDEX transaction_auto_index_fk_transaction_state (last_state ASC),
	FAMILY "primary" (id, client_invoice_number, customer_first_name, customer_last_name, customer_email, customer_phone, expiry_start_time, expiry_unit, expiry_duration, client_id, programme_id, transaction_timestamp, point_amount, money_amount, invoice_amount, last_state, payment_method, promotional_code, promotional_points, exchange_from, exchange_to, current_rate, client_commission_fee, client_pg_fee, programme_issuer_point, programme_issuer_currency, programme_point_discount_rate_percentage, programme_min_redeem_percentage, programme_facilitation_fee, programme_point_cancel_fee, programme_currency_cancel_fee, finished_at, created_at, created_by, updated_at, updated_by)
);

CREATE TABLE hub_transaction__transaction_state (
	id UUID NOT NULL DEFAULT gen_random_uuid(),
	transaction_id UUID NOT NULL,
	state_id UUID NOT NULL,
	created_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(),
	created_by UUID NOT NULL,
	updated_at TIMESTAMP WITH TIME ZONE NULL,
	updated_by UUID NULL,
	CONSTRAINT "primary" PRIMARY KEY (id ASC),
	CONSTRAINT fk_hub_transaction_state_transaction FOREIGN KEY (transaction_id) REFERENCES transaction (id),
	INDEX hub_transaction_id_idx (transaction_id ASC),
	CONSTRAINT fk_hub_transactino_state_state FOREIGN KEY (state_id) REFERENCES transaction_state (id),
	INDEX hub_transaction__transaction_state_auto_index_fk_hub_transactino_state_state (state_id ASC),
	FAMILY "primary" (id, transaction_id, state_id, created_at, created_by, updated_at, updated_by)
);

CREATE TABLE hub_user__access (
	user_id UUID NOT NULL,
	access_id UUID NOT NULL,
	created_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(),
	created_by UUID NOT NULL,
	updated_at TIMESTAMP WITH TIME ZONE NULL,
	updated_by UUID NULL,
	CONSTRAINT fk_user_id_ref_user FOREIGN KEY (user_id) REFERENCES "user" (id),
	INDEX hub_user__access_auto_index_fk_user_id_ref_user (user_id ASC),
	CONSTRAINT fk_access_id_ref_access FOREIGN KEY (access_id) REFERENCES access (id),
	INDEX hub_user__access_auto_index_fk_access_id_ref_access (access_id ASC),
	FAMILY "primary" (user_id, access_id, created_at, created_by, updated_at, updated_by, rowid)
);

CREATE TABLE log_activity (
	id UUID NOT NULL DEFAULT gen_random_uuid(),
	transaction_id UUID NOT NULL,
	"name" STRING NOT NULL,
	description STRING NOT NULL,
	created_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(),
	created_by UUID NOT NULL,
	updated_at TIMESTAMP WITH TIME ZONE NULL,
	updated_by UUID NULL,
	CONSTRAINT "primary" PRIMARY KEY (id ASC),
	INDEX log_activity_transaction_idx (transaction_id ASC),
	FAMILY "primary" (id, transaction_id, "name", description, created_at, created_by, updated_at, updated_by)
);

CREATE TABLE promotional_point (
	id UUID NOT NULL DEFAULT gen_random_uuid(),
	client_id UUID NULL,
	programme_id UUID NULL,
	code STRING NULL,
	point DECIMAL(20,5) NULL,
	start_date INT NOT NULL DEFAULT 0:::INT,
	expiry_date INT NOT NULL DEFAULT 0:::INT,
	used BOOL NOT NULL DEFAULT false,
	created_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(),
	created_by UUID NOT NULL,
	updated_at TIMESTAMP WITH TIME ZONE NULL,
	updated_by UUID NULL,
	CONSTRAINT "primary" PRIMARY KEY (id ASC),
	UNIQUE INDEX promotional_point_code_key (code ASC),
	INDEX promotional_point_code_client_id_idx (code ASC, client_id ASC),
	CONSTRAINT fk_client_id_ref_client FOREIGN KEY (client_id) REFERENCES client (id),
	INDEX promotional_point_auto_index_fk_client_id_ref_client (client_id ASC),
	CONSTRAINT fk_programme_id_ref_programme FOREIGN KEY (programme_id) REFERENCES programme (id),
	INDEX promotional_point_auto_index_fk_programme_id_ref_programme (programme_id ASC),
	FAMILY "primary" (id, client_id, programme_id, code, point, start_date, expiry_date, used, created_at, created_by, updated_at, updated_by)
);

CREATE TABLE refund (
	id UUID NOT NULL DEFAULT gen_random_uuid(),
	transaction_id UUID NOT NULL,
	refund_amount DECIMAL(20,5) NOT NULL,
	point_amount DECIMAL(20,5) NOT NULL,
	money_amount DECIMAL(20,5) NOT NULL,
	reason STRING NOT NULL,
	created_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(),
	created_by UUID NOT NULL,
	updated_at TIMESTAMP WITH TIME ZONE NULL,
	updated_by UUID NULL,
	CONSTRAINT "primary" PRIMARY KEY (id ASC),
	CONSTRAINT fk_refund_transaction FOREIGN KEY (transaction_id) REFERENCES transaction (id),
	UNIQUE INDEX refund_transaction_id_key (transaction_id ASC),
	FAMILY "primary" (id, transaction_id, refund_amount, point_amount, money_amount, reason, created_at, created_by, updated_at, updated_by)
);

CREATE TABLE token (
	id UUID NOT NULL DEFAULT gen_random_uuid(),
	client_id UUID NOT NULL,
	token STRING NOT NULL,
	secret_key STRING NOT NULL,
	is_active BOOL NOT NULL DEFAULT false,
	expiry_date INT NOT NULL DEFAULT 0:::INT,
	created_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(),
	created_by UUID NOT NULL,
	updated_at TIMESTAMP WITH TIME ZONE NULL,
	updated_by UUID NULL,
	CONSTRAINT "primary" PRIMARY KEY (id ASC),
	INDEX token_idx (token ASC),
	CONSTRAINT fk_token_client FOREIGN KEY (client_id) REFERENCES client (id),
	INDEX token_auto_index_fk_token_client (client_id ASC),
	FAMILY "primary" (id, client_id, token, secret_key, is_active, expiry_date, created_at, created_by, updated_at, updated_by)
);

CREATE TABLE transaction_item (
	id UUID NOT NULL DEFAULT gen_random_uuid(),
	transaction_id UUID NOT NULL,
	"name" STRING NOT NULL,
	category STRING NOT NULL,
	price DECIMAL(20,5) NOT NULL,
	quantity INT NOT NULL,
	created_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(),
	created_by UUID NOT NULL,
	updated_at TIMESTAMP WITH TIME ZONE NULL,
	updated_by UUID NULL,
	CONSTRAINT "primary" PRIMARY KEY (id ASC),
	CONSTRAINT fk_transaction FOREIGN KEY (transaction_id) REFERENCES transaction (id),
	INDEX transaction_item_auto_index_fk_transaction (transaction_id ASC),
	FAMILY "primary" (id, transaction_id, "name", category, price, quantity, created_at, created_by, updated_at, updated_by)
);















































































